import React from 'react'
import {NavFlex, MenuLink, NavLogo} from './style'
import {GiFlamingTrident} from 'react-icons/gi'

const NavBar = () => {
    return (
        <NavFlex>
            <NavLogo>
                <GiFlamingTrident/>
            </NavLogo>
            
        </NavFlex>
    )
}

export default NavBar
